import React, { Fragment } from "react";
import { Card, Carousel } from "antd";
import "./style.css";
import "antd/dist/antd.css";

export default () => {
  return (
    <Fragment>
      <div className="newPosition">
        <div className="newPosition-content">
          <div className="newPosition-list">
            <Card title="最新职位" extra="更多" bodyStyle={{ padding: 0 }}>
              <Carousel autoplay slidesToShow={3} vertical={true} verticalSwiping={true} infinite={true}>
                <h3>1</h3>
                <h3>2</h3>
                <h3>3</h3>
                <h3>4</h3>
              </Carousel>
            </Card>
          </div>
        </div>
      </div>
    </Fragment>
  );
};
